import React from "react";
import { useNavigate } from "react-router-dom";
import './LoginPage.css';
import google from './Assets/google.png';
import facebook from './Assets/facebook.png';
import whatsapp from './Assets/whatsapp.png';

function LoginPage() {
    const navigate = useNavigate();
    
    const handleLoginClick = () => {
        // Perform login logic here (e.g., validation, API call)
        navigate('/app');
    };

    const handleSignupClick = () => {
        navigate('/signup');
    };

    return (
        <>
        <div className="login-page">
        <div className="login-container">
            <div className="login-header">
                Login
            </div>
            <div className="username-field">
                <div className="label">
                    <h4>Username</h4>
                </div>
                <div className="input-field">
                    <input name="username" placeholder="Type your username" className="username" />
                </div>
            </div>
            <div className="password-field">
                <div className="label">
                    <h4>Password</h4>
                </div>
                <div className="input-field">
                    <input className="password" name="password" type="password" placeholder="Type your Password " />
                </div>
                <div className="forgot-password">
                    <p>Forgot password?</p>
                </div>
            </div>
            <div className="login-button">
                <button type="button" onClick={handleLoginClick}>Login</button>
            </div>
            <div className="sign-up">
                <p>Signup Using</p>
                <div className="logos">
                    <img src={google} alt="Google" />
                    <img src={facebook} alt="Facebook" />
                    <img src={whatsapp} alt="Whatsapp" />
                </div>
            </div>
            <div className="signup-button">
                <button type="button" onClick={handleSignupClick}>Signup</button>
            </div>
        </div>
        </div>
        </>
    );
}

export default LoginPage;
